import React from 'react'
import { Transition } from 'react-transition-group'
import './loader.scss'

const Loader = loader => {
  return (
    <Transition>
      <div className='loader'>
        <div className='loader__circle'></div>
      </div>
    </Transition>
  )
}

export default Loader
